main#books {

  .timeline {

    .container {

      h1 {
      }

      .wrap {
        margin-top: 1em;

        article {
          position: relative;

          &:not(:first-of-type) {
            padding-top: 80px;

            @media (min-width: 992px) {
              padding-top: 0;
            }
          }

          @media (min-width: 992px) {
            display: flex;
            justify-content: space-between;
            align-items: center;
            height: 650px;

            &:nth-of-type(odd) {
              flex-direction: row-reverse;

              div {
                text-align: left;
              }
            }

            &:nth-of-type(even) {

              div {
                text-align: right;
              }
            }
          }

          figure {

            img {
              max-width: 220px;

              @media (min-width: 992px) {
                max-width: 250px;
              }
            }

            figcaption {
              display: none;
            }
          }

          .timeline-line {
            display: none;
            height: 100%;
            width: 12px;
            background-color: $secondary;
            position: absolute;
            left: 50%;
            transform: translateX(-50%);

            @media (min-width: 992px) {
              display: block;
            }

            svg {
              position: absolute;
              top: 50%;
              left: 50%;
              transform: translate(-50%, -50%);
            }

            &.top {
              top: 50%;
              height: 50%;

              svg {
                top: 0;
              }
            }

            &.bottom {
              top: 0;
              height: 50%;

              svg {
                top: 100%;
              }
            }
          }

          div {

            h2 {
              padding-top: 0.5em;
            }

            p {
              max-width: 500px;
              margin-left: auto;
              margin-right: auto;
              margin-top: 1.5em;

              @media(min-width: 992px) {
                max-width: 300px;
              }
            }

            a {
              margin-top: 2.5em;
            }
          }
        }
      }
    }
  }
}

