          font-size: 4em;
          text-indent: 30px;
          line-height: 0;
          margin-right: 0.05em;
        }
      }

      .art {
        position: relative;

        picture {

          img {

          }
        }

        span {
          position: absolute;
          top: 0;
          left: 0;
          font-size: 2.5em;
          font-family: 'Oswald', sans-serif;
          line-height: 1;
        }

        &.jamais {
          display: flex;
          justify-content: flex-end;
          background-color: #000;

          picture {

            img {
              max-width: 300px;
            }
          }

          span {
            bottom: 0;
            top: initial;

            @media (min-width: 850px) {
              bottom: 40%;
              left: 10px;
              text-align: left;
              width: 450px;
            }
          }
        }

        &.secrets {
          background-color: #000;
          display: flex;
          justify-content: flex-end;
          max-height: 400px;


          picture {

            img {
              object-fit: cover;
              height: 100%;
              object-position: 0% 60%;
              max-width: 750px;
              height: 100%;
            }
          }

          span {
            top: 10px;
            width: 250px;
            left: 50%;
            transform: translateX(-50%);

            @media (min-width: 790px) {
              left: 50px;
              top: 50px;
              transform: none;
            }
          }
        }

        &.escape {
          background-color: #000;

          picture {

            img {
              max-width: 350px;
            }
          }

          span {
            top: 30px;
            right: 0;
            left: 0;

            @media (min-width: 768px) {
              right: initial;
              top: 20%;
              left: 30px;
            }
          }
        }

        &.sweet-home {
          background-color: #000;

          picture {

            img {
              max-width: 350px
            }
          }

          span {
            top: 50px;
            right: 0;
            left: 0;
            max-width: 400px;
            margin-left: auto;
            margin-right: auto;

            @media (min-width: 600px) {
              bottom: 30px;
              top: initial;
              left: 30px;
              margin: 0;
            }
          }
        }

        &.watcher {
          background-color: #000;
          display: flex;
          justify-content: flex-end;

          picture {

            img {
              max-width: 450px;
            }
          }

          span {
            top: 30px;

            @media (min-width: 375px) {
              max-width: 350px;
              left: 0;
              top: 50px;
            }
            @media (min-width: 768px) {
              max-width: 350px;
              left: 30px;
              top: initial;
              bottom: 50px;
              transform: translateY(-50%);
            }
          }
        }
      }
    }
